import { useField } from "formik";
import {
    StyledTextInput, 
    StyledLablel
} from "./../components/Styles";

export const TextInput = ({...props}) => {
    const [field, meta] = useField(props);

    return(
        <div>
            <StyledLablel htmlFor={props.name}>
                {props.label}
            </StyledLablel>
            <StyledTextInput
                {...field}
                {...props}
            />
        </div>
    )
}
